import React from 'react';

const renderInputList = ({input, label, type, name, 'data-id': dataId, id, className, key}) => (
  <div className="form-item" key={key}>
    <label>
      {label}
    </label>
    <input 
      {...input} 
      type={type} 
      name={name}
      data-id={dataId}
      id={id}
      className={className}
      autoComplete="off"
    />
  </div>
)

export default renderInputList;
